import React from 'react';
import {View,Text,TouchableOpacity,Button,SafeAreaView,KeyboardAvoidingView,Picker} from 'react-native';
import {css} from '../assets/Css/css';

export default function Preditor1 (props1) {
    const [selectedValue1, setSelectedValue1] = useState('Bovespa')
    const [selectedValue2, setSelectedValue2] = useState('Bovespa')
    return (
        <SafeAreaView style = {css.fundo}>
            <KeyboardAvoidingView>
            <View style = {css.container1}>
            
                <Picker selectedValue={selectedValue1} style={{ height: 50, width: 150 }} onValueChange={(itemValue, itemIndex) => setSelectedValue1(itemValue)}>
                    <Picker.Item label="Bovespa" value="^BVSP" />
                    <Picker.Item label="Dow Jones Industrial Average" value="^DJI" />	
                    <Picker.Item label="NASDAQ Composto" value="^IXIC" />
                </Picker>
                <Picker selectedValue={selectedValue2} style={{ height: 50, width: 150 }} onValueChange={(itemValue, itemIndex) => setSelectedValue2(itemValue)}>
                    <Picker.Item label="Banco do Brasil" value="BBAS3.SA" />
                    <Picker.Item label="Petrobras" value="PETR4.SA" />	
                    <Picker.Item label="Vale" value="VALE5.SA" />
                </Picker>
                <TouchableOpacity title = "Predição" onPress={()=>props1.navigation.navigate('Preditor2')} style = {css.button1}>Preditor2</TouchableOpacity>   
            </View>
            </KeyboardAvoidingView>
        </SafeAreaView>
    );
    
}
